import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import "./header.css";

const Header = () => {
  return (
    <div className="header">
      <div className="headerList">
        <div className="headerListItem">
          <FontAwesomeIcon icon="fa-solid fa-bed" />
        </div>
      </div>
    </div>
  );
};

export default Header;
